import React, { Component } from "react";
import images from "./images"
import Image from "./Image"
class ImageContainer extends Component {

    state = {
        imageArray: images
    };

    //Shuffle images around


    //Array of image names maybe saved in state and then updated with map



    render() {
        return (
            <div className='container'>
                <div className='row'>
                    <div className='col-md-6'>
                        <ol>


                            {
                                this.state.imageArray.slice(0, 5).map(({ id, src, title }) => <li><Image key={id} source={src} alt={title} />
                                </li>)
                            }
                        </ol>
                    </div>

                </div>

                <div className='row'>
                    <div className='col-md-6'>
                        <ol>


                            {
                                this.state.imageArray.slice(5, 10).map(({ id, src, title }) => <li><Image key={id} source={src} alt={title} />
                                </li>)
                            }
                        </ol>
                    </div>

                </div>

                <div className='row'>
                    <div className='col-md-6'>
                        <ol>


                            {
                                this.state.imageArray.slice(10, 15).map(({ id, src, title }) => <li><Image key={id} source={src} alt={title} />
                                </li>)
                            }
                        </ol>
                    </div>

                </div>

                <div className='row'>
                    <div className='col-md-6'>
                        <ol>


                            {
                                this.state.imageArray.slice(15, 20).map(({ id, src, title }) => <li><Image key={id} source={src} alt={title} />
                                </li>)
                            }
                        </ol>
                    </div>

                </div>

                <div className='row'>
                    <div className='col-md-6'>
                        <ol>


                            {
                                this.state.imageArray.slice(20, 25).map(({ id, src, title }) => {<li><Image key={id} source={src} alt={title} />
                                </li>})
                            }
                        </ol>
                    </div>

                </div>


            </div>

        )

    };

}
export default ImageContainer;
